import React, { useEffect, useState } from 'react';
import axios from 'axios';

const UserList = () => {
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true); // Add a loading state
  const [error, setError] = useState(null); // Add an error state

  useEffect(() => {
    const fetchUsers = async () => {
      try {
        const response = await axios.get('http://localhost:3001/api/registration/getUsers');
        setUsers(response.data);
        setLoading(false); // Set loading to false once data is fetched
      } catch (err) {
        setError(err.message);
        setLoading(false); // Set loading to false in case of error
      }
    };

    fetchUsers();
  }, []);

  if (loading) return <p>Loading...</p>; // Display loading message
  if (error) return <p>Error: {error}</p>; // Display error message

  return (
    <div>
      <h2>User List</h2>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Email</th>
            <th>Date of Birth</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {users.map((user) => (
            <tr key={user.ID}>
              <td>{user.Name}</td>
              <td>{user.Email}</td>
              <td>{user.DateOfBirth}</td>
              <td>
                <button style={{ backgroundColor: 'blue', color: 'white' }}>Update</button>
                <button style={{ backgroundColor: 'red', color: 'white' }}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default UserList;
